window.bookSummaryJSON = "<p>It's been months since Laurel left her home and family to escape her destiny - a destiny that has her giving birth to a demigod. She's getting by with the help of Aurore, a Titaness with a dangerous secret of her own, who becomes charged with Laurel's protection. One day, when Laurel accidentally meets the now cold-blooded Sampson, she knows she has lost his love for good. </p> <p>And when she learns the ugly truth about her mother's death, she never again wants to have anything to do with the Olympians, resigning herself to a future in safety among the Titans. Only when she finds out that the Keepers will stop at nothing to get her back, and that her family is in immediate danger, she returns to Sooke where the son of darkness is waiting for her - and he is determined to fulfill his and Laurel's destiny.</p> <p><i>Contains mature themes.</i></p>"; 
